          icon: 'fa fa-camera-retro',
          type: 'menu',
          active: false
        }
      },
      {
        index: '/hms/housingDetails/:id',
        component: () => import('@/views/hms/housing-details'),
        type: 'menu',
        meta: {
          active: false,
        },
        hidden: true
      }
    ]
  },
  {
    name: 'order',
    meta: {
      title: '订单',
      icon: 'fa fa-camera-retro'
    },
    sub: [
      {
