          active: false,
        },
        hidden: true
      },
      {
        index: '/oms/orderDetails/:id',
        component: () => import('@/views/oms/order-details'),
        meta: {
          active: false,
        },
        hidden: true
      }
    ]
  },
  {
    name: 'ticket',
    meta: {
